import React from 'react';
import './components.css';

const Qualifications = () => {
  return (
    <section id="qualifications">
      <p>Certifications: Certified in Python and HTML through MIMO, demonstrating proficiency in web development fundamentals.

Achievements: Winner of multiple robotics competitions during my time in the robotics club, showcasing problem-solving abilities and teamwork skills from a young age.

Skills: Proficient in SQL, React, JavaScript, HTML, Python, and C#, with hands-on experience in developing robust web applications and solving complex technical challenges.</p>
    </section>
  );
};

export default Qualifications;
